  render() {
    return (
      <div className="App">
        <Header />
        <LandingPage />
        <div className="test-skew" style={{backgroundColor: "black", height: "50vh",
      "-webkit-transform": "skewY(-4deg)",
      transform: "skewY(-4deg)"}}></div>
    </div>
    );
  }
}

export default App;
